import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Click on the first product card to open the modal
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.locator('.product-card').first().click();

    // 2. Wait for the modal to be visible
    const modalLocator = page.locator('#productModal');
    await modalLocator.waitFor({ state: 'visible', timeout: 5000 });

    // 3. Take a screenshot with the modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // 4. Extract the display style of the modal before pressing Escape
    const displayStyleBefore = await modalLocator.evaluate(el => window.getComputedStyle(el).display);

    // 5. Press the Escape key to close the modal
    await page.keyboard.press('Escape');

    // 6. Wait for the modal to be hidden
    await modalLocator.waitFor({ state: 'hidden', timeout: 5000 });

    // 7. Take a screenshot after the modal is closed
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    // 8. Extract the display style of the modal after pressing Escape
    const displayStyleAfter = await modalLocator.evaluate(el => window.getComputedStyle(el).display);

    return {
      success: true,
      action: "Closed a product detail modal by pressing the Escape key.",
      extractedData: {
        modalDisplayStyleBefore: displayStyleBefore,
        modalDisplayStyleAfter: displayStyleAfter
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to close modal with Escape key",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
